import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ height: 150, clear: "both", paddingTop: 120, textAlign: "center",}}
      className="jumbotron"
    >
      Employee Directory
    </div>
  );
}

export default Jumbotron;
